import { Button, Table } from 'antd';
import axios from 'axios';
import { useEffect, useState } from 'react';
import url from '../components/host';

const columns = [
  {
    title: 'Id',
    dataIndex: 'id',
  },
  {
    title: 'Name',
    dataIndex: 'name',
  },
  {
    title: 'Price',
    dataIndex: 'price',
  },
  {
    title: 'Status',
    dataIndex: 'status',
  },
  {
    title: 'Status',
    dataIndex: 'is_active',
    render: (el ,a)=><div>{el.is_active?("bor"):("yo`q")}</div>


  },
  {
    title: "Edit",
    key: "edit",
    width: "5%",
    render: () => {
        return <div><Button style={{ background: 'orange', color: 'white' }} type="text">Edit</Button></div>
    }
},
{
  title: "Delete",
  key: "delete",
  width: "5%",
  render: () => {
      return <div><Button type="danger">O'chirish</Button></div>
  }
},
];

const Tables = () => {
  var [getDataMp, setData] = useState([])
  const [selectedRowKeys, setSelectedRowKeys] = useState([]);
  const [loading, setLoading] = useState(false);
  const [data, setdata]=useState([])

  function getData() {
    axios.get(`${url}/api/cars/`).then(res => {
      setdata( res.data )
    })
  }
  useEffect(() => {
    getData()
  }, [])




  const start = () => {
    setLoading(true);
    // ajax request after empty completing
    setTimeout(() => {
      setSelectedRowKeys([]);
      setLoading(false);
    }, 1000);
  };


  return (
    <div>
      <Table  columns={columns} dataSource={data} />
    </div>
  );
};
export default Tables;
